import React from "react";

export default function Sender(props) {
    return (
        <>
            <div style={{
                display: "flex",
                flexDirection: "row",
                flexWrap: "wrap",
                justifyContent: "center",
                width: "100%",
                alignItems: "flex-end",
                alignSelf: "flex-end",
                bottom: "10px",
                position: "fixed",
                marginTop: "10px",
                alignContent: "center",
            }}>
                <input type="text" placeholder="Message" style={{
                    padding: "5px",
                    borderRadius: "5px",
                    border: "1px solid lightgrey",
                    width: "80%",
                    
                }} />
                <button style={{
                    marginLeft: "5px",
                    padding: "5px",
                    backgroundColor: "#218aff",
                    color: "white",
                    border: "none",
                    borderRadius: "5px",
                    fontSize: "1rem",
                    fontWeight: "bold",
                }}>Send</button>
            </div>
        </>
    );
}
